def Calculate_average(nums):
    return sum(nums)/len(nums)
def Calculate_standard_deviation(nums,mean):
    return ((pow((mean-sum(nums)/len(nums)),2))*(1/(len(nums)-1)))**0.5
def average_and_std_dev(nums):
    mean=Calculate_average(nums)
    std_dev=Calculate_standard_deviation(nums,mean)
    return (mean,std_dev)
